class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        max_sub = ''
        for i in range(len(s)):
            sub = ''
            if len(max_sub) >= 95:
                return 95
            for j in range(i, len(s)):
                if s[j] in sub:
                    break
                sub = s[i:j + 1]
                if len(sub) > len(max_sub):
                    max_sub = sub
        return len(max_sub)


